import ReactDOM from 'react-dom';
import './Accommodations.css';

import { Routes, Route, Outlet, Link } from "react-router-dom";

export default function Accommodations() {
	return(
		<>
			<div className = "acc-container">
				<div className = "acc-content">
					<div className="acc-title">

					</div>
					<img src="./images/lembas.jpg" alt="" />
					<div className="acc-text">Visit where the meeting of the council of Elrond took place</div>
				</div>
				<div className = "divider" />
				<div className = "acc-content">
					<div className="acc-title">Narsil</div>
					<img src="./images/narsil.png" alt="" />
					<div className="acc-text">Check out Narsil, the very sword that Isildur used to sever the One Ring from Sauron's hand</div>
				</div>
			</div>
		</>
	);
}
